import React from "react";
import Box from '@mui/material/Box';
import './ChatPage.css'

export default function ChatPage () {
    return (
        <div className='chat-page'>
            <Box
                className='contacts-bar'
                height={650}
                width={200}
                my={6}

                display="flex"
                alignItems="center"
                gap={4}
                p={2}
                sx={{ 
                    border: '2px solid black',
                    backgroundColor: 'white' 
                }}
            >

            </Box>
        </div>
    )
}
